import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello World</h1>
        <h2>Vamos aromatizar no ambiente</h2>
        <h3>Deixar a sua casa mais cheirosa</h3>
        <h4>Sente que cheirinho bom gente!</h4>
      </header>
    </div>
  );
}

export default App;
